// src/pages/WhiteboardLabelingPage.js
import React, { useState } from "react";
import { useParams, useNavigate } from "react-router-dom";
import { Container, Typography, Button, IconButton } from "@mui/material";
import { ArrowBack } from "@mui/icons-material";
import { Stage, Layer, Image as KonvaImage, Rect } from "react-konva";
import useImage from "use-image";

const whiteboards = [
  {
    id: "wb_456",
    imageUrl: "https://via.placeholder.com/1200x800",
    annotated: true,
  },
  {
    id: "wb_457",
    imageUrl: "https://via.placeholder.com/1200x800",
    annotated: false,
  },
  {
    id: "wb_458",
    imageUrl: "https://via.placeholder.com/1200x800",
    annotated: false,
  },
];

function WhiteboardLabelingPage() {
  const { id } = useParams();
  const navigate = useNavigate();
  const whiteboard = whiteboards.find((wb) => wb.id === id);
  const [image] = useImage(whiteboard ? whiteboard.imageUrl : "");

  const [annotations, setAnnotations] = useState([]);
  const [newAnnotation, setNewAnnotation] = useState(null);

  const handleMouseDown = (e) => {
    const { x, y } = e.target.getStage().getPointerPosition();
    setNewAnnotation({ x, y, width: 0, height: 0 });
  };

  const handleMouseMove = (e) => {
    if (!newAnnotation) return;
    const stage = e.target.getStage();
    const pointerPosition = stage.getPointerPosition();
    setNewAnnotation({
      ...newAnnotation,
      width: pointerPosition.x - newAnnotation.x,
      height: pointerPosition.y - newAnnotation.y,
    });
  };

  const handleMouseUp = () => {
    if (newAnnotation) {
      setAnnotations((prevAnnotations) => {
        const updatedAnnotations = [...prevAnnotations, newAnnotation];
        console.log("Annotations saved:", updatedAnnotations); // Auto-save action
        return updatedAnnotations;
      });
      setNewAnnotation(null); // Reset current annotation
    }
  };

  const handleNext = () => {
    const currentIndex = whiteboards.findIndex((wb) => wb.id === id);
    const nextIndex = (currentIndex + 1) % whiteboards.length;
    navigate(`/label/${whiteboards[nextIndex].id}`);
  };

  const handlePrevious = () => {
    const currentIndex = whiteboards.findIndex((wb) => wb.id === id);
    const prevIndex =
      (currentIndex - 1 + whiteboards.length) % whiteboards.length;
    navigate(`/label/${whiteboards[prevIndex].id}`);
  };

  return (
    <Container
      maxWidth={false}
      style={{
        overflow: "auto",
        height: "100vh",
        display: "flex",
        flexDirection: "column",
      }}
    >
      {/* Back Arrow Icon */}
      <IconButton
        onClick={() => navigate("/whiteboards")} // Direct navigation to selection screen
        style={{
          position: "fixed",
          top: "20px",
          left: "20px",
          zIndex: 1000,
          opacity: 0.8,
          backgroundColor: "white",
          borderRadius: "50%",
        }}
      >
        <ArrowBack />
      </IconButton>

      {/* Anchored Whiteboard ID Display */}
      <Typography
        variant="h6"
        style={{
          position: "fixed",
          top: "20px",
          left: "50%",
          transform: "translateX(-50%)",
          zIndex: 1000,
          opacity: 0.8,
          backgroundColor: "white",
          padding: "5px 15px",
          borderRadius: "4px",
        }}
      >
        Whiteboard ID: {id}
      </Typography>

      {whiteboard ? (
        <Stage
          width={1200}
          height={800}
          onMouseDown={handleMouseDown}
          onMouseMove={handleMouseMove}
          onMouseUp={handleMouseUp}
          style={{ margin: "0 auto" }}
        >
          <Layer>
            <KonvaImage image={image} width={1200} height={800} />
            {annotations.map((rect, i) => (
              <Rect
                key={i}
                x={rect.x}
                y={rect.y}
                width={rect.width}
                height={rect.height}
                fill="rgba(255,165,0,0.5)"
              />
            ))}
            {newAnnotation && (
              <Rect
                x={newAnnotation.x}
                y={newAnnotation.y}
                width={newAnnotation.width}
                height={newAnnotation.height}
                fill="rgba(0,0,255,0.5)"
              />
            )}
          </Layer>
        </Stage>
      ) : (
        <Typography color="error">Whiteboard not found</Typography>
      )}

      {/* Anchored Previous Button */}
      <Button
        variant="contained"
        color="secondary"
        onClick={handlePrevious}
        style={{
          position: "fixed",
          bottom: "20px",
          left: "20px",
          opacity: 0.7,
        }}
      >
        Previous Whiteboard
      </Button>

      {/* Anchored Next Button */}
      <Button
        variant="contained"
        color="secondary"
        onClick={handleNext}
        style={{
          position: "fixed",
          bottom: "20px",
          right: "20px",
          opacity: 0.7,
        }}
      >
        Next Whiteboard
      </Button>
    </Container>
  );
}

export default WhiteboardLabelingPage;
